{
    allocators.returnMatrix(size, data);
}

// Naive way
void Matrix::Multiply1(const Matrix &m2, Matrix& output)
{
    for (int i = 0; i < size; ++i)
        for (int j = 0; j < size; ++j)
        {
            double sum = 0;
            for (int k = 0; k < size; ++k)
                sum += get(i, k) * get(k, j);
            output.set(i, j, sum);
        }
}
// Strassen’s algorithm
void Matrix::Multiply2(const Matrix &m2, Matrix& output)
{
    if (size == 1)
    {
        output.set(0, 0, get(0, 0) * m2.get(0, 0));
        return;
    }
    
    int subSize = size / 2;
    
    Matrix M1(subSize);
    Matrix M2(subSize);
    Matrix M3(subSize);
    Matrix M4(subSize);
    Matrix M5(subSize);
    Matrix M6(subSize);
    Matrix M7(subSize);
    
    Matrix T1(*this, 0);
    T1.plus(*this,3);
    Matrix T2(m2, 0);
    T2.plus(m2, 3);
    T1.Multiply2(T2, M1); // M1 = (A11 + A22)(B11 + B22)
	T1.plus(*this, 2, *this, 3);
    T1.Multiply2(TemperateMatrixStatic(m2, 0), M2); // M2 = (A21 + A22)B11
	T1.minus(m2, 1, m2, 3);
	TemperateMatrixStatic(*this, 0).Multiply2(T1, M3); // M3 = A11(B12 - B22)
	T1.minus(m2, 2, m2, 0);
	TemperateMatrixStatic(*this, 3).Multiply2(T1, M4); // M4 = A22(B21 - B11)
	T1.plus(*this, 0, *this, 1);
    T1.Multiply2(TemperateMatrixStatic(m2, 3), M5); // M5 = (A11 + A12)B22
	T1.minus(*this, 2, *this, 0);
	T2.plus(m2, 0, m2, 1);
    T1.Multiply2(T2, M6); // M6 = (A21 - A11)(B11 + B12)
	T1.minus(*this, 1, *this, 3);
	T2.plus(m2, 2, m2, 3);
    T1.Multiply2(T2, M7); // M7 = (A12 - A22)(B21 + B22)
    
	output.set(0, M1);
	output.plus(0, M4);
	output.minus(0, M5);
	output.plus(0, M7);
	output.set(1, M3);
	output.plus(1, M5);
	output.set(2, M2);
	output.plus(2, M4);
	output.set(3, M1);
	output.minus(3, M2);
	output.plus(3, M3);
	output.plus(3, M6);
}

Matrix& Matrix::operator+=(const Matrix &m)
{
	int size2 = size * size;
	for (int i = 0; i < size2; ++i)
		data[i] += m.data[i];
	return *this;
}

Matrix& Matrix::operator-=(const Matrix &m)
{
	int size2 = size * size;
	for (int i = 0; i < size2; ++i)
		data[i] -= m.data[i];
	return *this;
}

Matrix& Matrix::plus(const Matrix &m, int position)
{
	int size2 = size * size;
	for (int i = 0; i < size2; ++i)
		data[i] += m.data[i + position * size2];
	return *this;
}

Matrix& Matrix::plus(const Matrix &m, int position, const Matrix &m2, int position2)
{
	int size2 = size * size;
	for (int i = 0; i < size2; ++i)
		data[i] = m.data[i + position * size2] + m2.data[i + position2 * size2];
	return *this;
}

Matrix& Matrix::plus(int position, const Matrix &m)
{
	int size2 = m.size * m.size;
	for (int i = 0; i < size2; ++i)
		data[i + position * size2] += m.data[i];
	return *this;
}

Matrix& Matrix::minus(const Matrix &m, int position)
{
	int size2 = size * size;
	for (int i = 0; i < size2; ++i)
		data[i] -= m.data[i + position * size2];
	return *this;
}

Matrix& Matrix::minus(const Matrix &m, int position, const Matrix &m2, int position2)
{
	int size2 = size * size;
	for (int i = 0; i < size2; ++i)
		data[i] = m.data[i + position * size2] - m2.data[i + position2 * size2];
	return *this;
}

Matrix& Matrix::minus(int position, const Matrix &m)
{
	int size2 = m.size * m.size;
	for (int i = 0; i < size2; ++i)
		data[i + position * size2] -= m.data[i];
	return *this;
}

void Matrix::set(const Matrix &m, int position)
{
	int size2 = size * size;
    memcpy(data, m.data + position * size2, size2 * sizeof(double));
}

void Matrix::set(int position, const Matrix &m)
{
	int size2 = m.size * m.size;
    memcpy(data + position * size2, m.data, size2 * sizeof(double));
}

void Matrix::split(Matrix &_11, Matrix &_12, Matrix &_21, Matrix &_22) const
{
    int smallerSize = _11.size;
	int smallerSize2 = smallerSize * smallerSize;
    memcpy(_11.data, data, smallerSize2 * sizeof(double));
    memcpy(_12.data, data + smallerSize2, smallerSize2 * sizeof(double));
    memcpy(_21.data, data + smallerSize2 * 2, smallerSize2 * sizeof(double));
    memcpy(_22.data, data + smallerSize2 * 3, smallerSize2 * sizeof(double));
}

void Matrix::merge(const Matrix &_11, const Matrix &_12, const Matrix &_21, const Matrix &_22)
{
    int smallerSize = _11.size;
	int smallerSize2 = smallerSize * smallerSize;
	memcpy(data, _11.data, smallerSize2 * sizeof(double));
	memcpy(data, _12.data + smallerSize2, smallerSize2 * sizeof(double));
	memcpy(data, _21.data + smallerSize2 * 2, smallerSize2 * sizeof(double));
	memcpy(data, _22.data + smallerSize2 * 3, smallerSize2 * sizeof(double));
}

